// src/components/Dashboard.js
import React, { useEffect, useState } from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';
import {
  HomeOutlined,
  CheckSquareOutlined,
  TeamOutlined,
  UserOutlined,
} from '@ant-design/icons';
import { Link, Route, Routes } from 'react-router-dom';
import { API, graphqlOperation } from 'aws-amplify';
import { listAccounts } from '../graphql/queries'; // Adjust the path as per your project structure

import Home from './Home';
import Teams1 from './Teams';
import Tasks1 from './Tasks';
import Memberslist from './Memberslist';

const { Header, Content, Footer, Sider } = Layout;

const Dashboard = () => {
  const [collapsed, setCollapsed] = useState(false);
  const [accounts, setAccounts] = useState([]);
  const [name, setName] = useState('');

  useEffect(() => {
    fetchAccounts();
  }, []);

  const fetchAccounts = async () => {
    try {
      const accountData = await API.graphql(graphqlOperation(listAccounts));
      setAccounts(accountData.data.listAccounts.items);
    } catch (error) {
      console.log('Error fetching accounts', error);
    }
  };

  const addAccount = async () => {
    try {
      const newAccount = { name };
      await API.graphql(graphqlOperation(createAccount, { input: newAccount }));
      setAccounts([...accounts, newAccount]);
      setName('');
    } catch (error) {
      console.log('Error creating account', error);
    }
  };

  const onCollapse = (collapsed) => {
    setCollapsed(collapsed);
  };

  return (
    <Layout style={{ minHeight: '100vh', display: 'flex', justifyContent: 'center' }}>
      <Sider collapsible collapsed={collapsed} onCollapse={onCollapse}>
        <div className="logo" />
        <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
          <Menu.Item key="1" icon={<HomeOutlined />}>
            <Link to="/Home">Home</Link>
          </Menu.Item>
          <Menu.Item key="2" icon={<CheckSquareOutlined />}>
            <Link to="/tasks">Tasks</Link>
          </Menu.Item>
          <Menu.Item key="3" icon={<TeamOutlined />}>
            <Link to="/teams">Teams</Link>
          </Menu.Item>
          <Menu.Item key="4" icon={<UserOutlined />}>
            <Link to="/members">Members</Link>
          </Menu.Item>
        </Menu>
      </Sider>
      <Layout className="site-layout">
        <Header className="site-layout-background" style={{ padding: 0 }} />
        <Content style={{ margin: '0 16px' }}>
          <Breadcrumb style={{ margin: '16px 0' }}>
            <Breadcrumb.Item>Home</Breadcrumb.Item>
            <Breadcrumb.Item>Dashboard</Breadcrumb.Item>
          </Breadcrumb>
          <div className="site-layout-background" style={{ padding: 24, minHeight: 360 }}>
            <Routes>
              <Route path="/Home" element={<Home />} />
              <Route path="/tasks" element={<Tasks1 />} />
              <Route path="/teams" element={<Teams1 />} />
              <Route path="/members" element={<Memberslist accounts={accounts} addAccount={addAccount} setName={setName} name={name} />} />
            </Routes>
          </div>
        </Content>
        <Footer style={{ textAlign: 'center' }}>Craft Club Dashboard Â©2024 Created by <a href="https://www.linkedin.com/in/ali-9ihad/">Ali N. Abdulameer</a></Footer>
      </Layout>
    </Layout>
  );
};

export default Dashboard;
